import React, { Component } from 'react';
import base from '../../config/api.js';
let api = base.api();


class Home extends Component {
    constructor(props) {
        super(props);
        this.state = {
            message: ""
        };
    }
    render() {
        return (
            <article>
                <h1>Home</h1>
                <p>Web Client to filter and search for IP address, URLs, days, months, times, days & times and Months, Days & Times from the log file.</p>
            </article>
        );
    }
}

export default Home;
